import React, { useEffect,useState } from 'react';
function Book() {
  const [doctor, setdoctor] = useState("");
    useEffect(() => {
        fetch("/dataload")
        .then((response) => response.json())
        .then((data) => {
          console.log(data);
          setdoctor(data)
        })
        .catch((error) => {
          console.error(error);
        });
      }, []);
    return(
        <div className="App">
      {doctor
        .map((object, index) => (
            <div key={object._id}>
              {object.name}
              {object.message}
            </div>
        ))}
        </div>
    );
}
export default Book;
